int xPos = 0;
int yPos = 0;
uint16_t recievedData[15][8][8];

uint16_t convertToHex(uint16_t data)
{
	uint16_t response = 0;
	uint8_t byte1 = data >> 8;
	uint8_t byte2 = 0x00FF & data;
	response = byte1 < 0x61 ? (byte1 + 0xBC) << 8 : (byte1 + 0x99) << 8;
//	if(byte1 < 0x3A) //If byte is 0-9
//		response = (byte1 + 0xBC) << 8;
//	else	//Byte is a-f
//		response = (byte1 + 0x99) << 8;
	response += byte2 < 0x61 ? (byte2 + 0xBC): (byte2 + 0x99);
//	if(byte2 < 0x3A) //If byte is 0-9
//			response += (byte2 + 0xBC);
//		else	//Byte is a-f
//			response += (byte2 + 0x99);

	return response;
}


void displayMCU(int x, int y, uint16_t *colors)
{
	for(int i = 0; i<16; i++){
		for(int j = 0; j<16; j++){
			UG_DrawPixel(x+j , y+i, *(colors + i*16 + j));
			xPos = x;
			yPos = y;
		}
	}
}

uint8_t count = 0;
#define DECODE_BUFFER_LEN 3100
bool drawLCD(int16_t x, int16_t y, uint16_t w, uint16_t h, uint16_t* bitmap)
{
	printf("Count %d\r\n", count);
	count++;
	printf("x: %d\t y: %d\t w: %d\t h: %d\r\n", x, y, w, h);
	//displayMCU(x, y, bitmap);
	for(int i = 0; i<w; i++){
		for(int j = 0; j<h; j++){
			UG_DrawPixel(x+j , y+i, *(bitmap + i*16 + j));
			//displayMCU(x, y, bitmap);
			//printf("0x%x, ", *(bitmap+i*8+j));
		}
	}
  return 1; // 1 - to decode next block
}

