/**
  * @brief  The application entry point.
  * @retval int
  */
int main(void)
{
  /* MCU Configuration--------------------------------------------------------*/

  /* Reset of all peripherals, Initializes the Flash interface and the Systick. */
  HAL_Init();

  /* Configure the system clock */
  SystemClock_Config();

  /* Initialize all configured peripherals */
  MX_GPIO_Init();
  MX_USART2_UART_Init();
  MX_SPI1_Init();
  MX_USART1_UART_Init();
  /* USER CODE BEGIN 2 */
  RetargetInit(&huart2);
  LCD_init();
  UG_FillScreen(C_DEEP_PINK);
  /* USER CODE END 2 */

  /* Infinite loop */
  /* USER CODE BEGIN WHILE */
  uint8_t bytesA[BUFF_SIZE];
  uint8_t bytesB[BUFF_SIZE];
  /*TODO:
  	(maybe change first loop to while UART has no data)
  	(second loop to check if UART no longer has data?)
  	Find how to stop interrupt
  */
	uint16_t retVal, height, width;
	uint8_t decodeBuffer[DECODE_BUFFER_LEN]; //__attribute__((aligned(4)));
	JpgDecoder jpeg(drawLCD, decodeBuffer, DECODE_BUFFER_LEN);

	//retVal = jpeg.show(0, 0, jeanne, 7320);
	//printf("retVal: %d \r\n", retVal);

  //Get first set of data (maybe change to while UART has no data)
  printf("Entering Loop\r\n");
	HAL_UART_Receive_IT(&huart1, (uint8_t*) bytesA, BUFF_SIZE);
	while (1) {
		if (uartAReady == SET) {
			printf("received data\r\n");
			uartAReady = RESET;
			HAL_UART_Receive_IT(&huart1, (uint8_t*) bytesB, BUFF_SIZE);
			uartID = 'b';
			retVal = jpeg.show(0, 0, bytesA, BUFF_SIZE);
			printf("retVal: %d \r\n", retVal);
			retVal = jpeg.getDim(&width, &height, bytesA, BUFF_SIZE);
			printf("retVal: %d\t width: %d\t height: %d \r\n", retVal, width, height);
			break;
		}
	}

	//while(1);
	//Receive rest of data (check if UART no longer has data?)
  int busyCount = 0;
	while (1) {
		if (uartAReady == SET) {
			uartAReady = RESET;
			HAL_UART_Receive_IT(&huart1, (uint8_t*) bytesB, BUFF_SIZE);
			busyCount = 0;
			uartID = 'b';
			retVal = jpeg.show(xPos+16, yPos, bytesA, BUFF_SIZE);
			printf("retVal: %d \r\n", retVal);

		} else if (uartBReady == SET) {
			uartBReady = RESET;
			HAL_UART_Receive_IT(&huart1, (uint8_t*) bytesA, BUFF_SIZE);
			busyCount = 0;
			uartID = 'a';
			retVal = jpeg.show(xPos+16, yPos, bytesB, BUFF_SIZE);
			printf("retVal: %d \r\n", retVal);

		} else {
			if (huart1.RxState != HAL_UART_STATE_BUSY_RX) {
				busyCount++;
				if (busyCount > 1000000)
					break;
			}
		}

    /* USER CODE END WHILE */

    /* USER CODE BEGIN 3 */
  }
  //How to stop interrupt receive???
  printf("Broken\r\n");
  if(uartID == 'a'){
  	printf("BytesA End\r\n");
  } else {
  	printf("BytesB End\r\n");
  }

  /* USER CODE END 3 */
}

